import classes from './AvailableMeals.module.css'
import Card from "../UI/Card";

const DUMMY_MEALS = [
    {
        id: 'm1',
        name: 'Sushi',
        description: 'Finest fish and veggies',
        price: 22.99,
    },
    {
        id: 'm2',
        name: 'Poke',
        description: 'A hawaian specialty!',
        price: 16.5,
    },
    {
        id: 'm3',
        name: 'Beyond Burger',
        description: 'Juicy, meaty & totally plant-based.',
        price: 12.99,
    },
    {
        id: 'm4',
        name: 'Green Bowl',
        description: 'Healthy...and green...',
        price: 18.99,
    },
];

const AvailableMeals = () => {
    const mealsList = DUMMY_MEALS.map(meal => <MealItem key={meal.id} name={meal.name} description={meal.description}
                                                        price={meal.price}/>);
    return (
        <section className={classes.meals}>
            <Card>
                <ul>
                    {mealsList}
                </ul>
            </Card>
        </section>
    )
}
export default AvailableMeals;
